import React from "react";
import NewItem from "./components/NewItem";
import ItemList from "./components/ItemList";
import "./App.css";

function App() {
  // const onListHandle = () => {};

  const items = () => {
    [
      { id: 1, text: "Food & Drinks" },
      { id: 2, text: "Entertament & Fun" },
      { id: 3, text: "Trainning & Study" },
      { id: 4, text: "Clothes & Shoes" }
    ];
  };

  return (
    <div className="App">
      <ItemList itemsDetail={items}></ItemList>
      {/* <NewItem onListHandle={}></NewItem> */}
    </div>
  );
}

export default App;
